<node CREATED="1305803940381" ID="ID_824596884" MODIFIED="1306307146283" TEXT="Miselni vzorec prikazuje podatke iz treh razli&#x10d;nih projektov">
<node CREATED="1305803961682" ID="ID_399447705" MODIFIED="1305804336603" TEXT="Referen&#x10d;ne ambulante"/>
<node CREATED="1305803957647" ID="ID_1348856225" MODIFIED="1305804347753" TEXT="eOskrba"/>
<node CREATED="1305803966405" ID="ID_653192773" MODIFIED="1305804353190" TEXT="epSOS"/>
</node>
<node CREATED="1305803971220" ID="ID_812456001" MODIFIED="1305804005556" TEXT="&#x17d;elimo uskladiti podatke med projekti."/>
<node CREATED="1305804211055" ID="ID_921038666" MODIFIED="1305804271238" TEXT="Za vsak projekt imamo posebno oznako - viojli&#x10d;na 1 predstavlja referen&#x10d;ne ambulante, siva 2 predstavlja eOskrbo, modra 3 predstavlja epSOS."/>
<node CREATED="1305804273258" ID="ID_727873013" MODIFIED="1305804314476" TEXT="Podatki v miselnem vzorcu so lahko ozna&#x10d;eni z eno ali ve&#x10d; oznak projektov, kar pomeni, da se nek podatek pojavlja pri enem ali ve&#x10d; projektih."/>
<node CREATED="1305804011392" ID="ID_1412861590" MODIFIED="1305804035117" TEXT="Izlu&#x161;&#x10d;iti &#x17e;elimo neke splo&#x161;ne koncepte, ki se pogosto pojavljajo."/>
<node CREATED="1305804042419" ID="ID_1356005977" MODIFIED="1305804092122" TEXT="Trenutna razli&#x10d;ica miselnega vzorca je delovna, kar pomeni, da bo potrebno &#x161;e natan&#x10d;neje pregledati podatke ozr. koncepte."/>
<node CREATED="1305804093287" ID="ID_1185453818" MODIFIED="1306307466743" TEXT="Modelirati &#x17e;elimo arhetipe klini&#x10d;nih konceptov, ki pomeniji maksimalen nabor podatkov v povezavi z nekim klini&#x10d;nim konceptom.">
<font BOLD="true" NAME="SansSerif" SIZE="12"/>
</node>
<node CREATED="1305804135620" ID="ID_1310319311" MODIFIED="1306307468287" TEXT="Na koncu &#x17e;elimo zgraditi OpenEHR arhetipe, ki bodo na voljo celotni Sloveniji.">
<font BOLD="true" NAME="SansSerif" SIZE="12"/>
</node>
<node CREATED="1305804161452" ID="ID_1757136121" MODIFIED="1306307470430" TEXT="Veliko arhetipov je &#x17e;e pripravljenih v tujini in jih bomo samo prevedli in dopolnili za na&#x161;e potrebe.">
<font BOLD="true" NAME="SansSerif" SIZE="12"/>
</node>
